import{_ as e,o as a,c as t,O as n}from"./chunks/framework.9482e208.js";const v=JSON.parse('{"title":"§ 15.2-743 Fee for certain vacations, encroachments, and abandonments.","description":"","frontmatter":{},"headers":[],"relativePath":"vacode/15.2-743.md","filePath":"vacode/15.2-743.md"}'),r={name:"vacode/15.2-743.md"},o=n('<h1 id="§-15-2-743-fee-for-certain-vacations-encroachments-and-abandonments" tabindex="-1">§ 15.2-743 Fee for certain vacations, encroachments, and abandonments. <a class="header-anchor" href="#§-15-2-743-fee-for-certain-vacations-encroachments-and-abandonments" aria-label="Permalink to &quot;§ 15.2-743 Fee for certain vacations, encroachments, and abandonments.&quot;">​</a></h1><p>A county may charge a fee for processing applications for vacations as provided for in § <a href="http://law.lis.virginia.gov/vacode/15.2-2273/" target="_blank" rel="noreferrer">15.2-2273</a>, applications for encroachments as provided for in § <a href="http://law.lis.virginia.gov/vacode/15.2-2012/" target="_blank" rel="noreferrer">15.2-2012</a>, and petitions for abandonments under § <a href="http://law.lis.virginia.gov/vacode/33.2-917/" target="_blank" rel="noreferrer">33.2-917</a>. The fee for processing such applications and petitions shall be, at the county&#39;s discretion, either the amount provided in § <a href="http://law.lis.virginia.gov/vacode/15.2-2273/" target="_blank" rel="noreferrer">15.2-2273</a>, the amount provided in § <a href="http://law.lis.virginia.gov/vacode/15.2-2012/" target="_blank" rel="noreferrer">15.2-2012</a>, or an amount not to exceed the county&#39;s demonstrable costs for such processing, which costs may include title examination and appraisal of the property that is the subject of the application or petition. In lieu of including such costs in the application fee, the county may require submission of a title examination and appraisal by the applicant or petitioner.</p><p>1991, c. 143, § 15.1-687.21; 1997, c. 587; 2005, cc. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?051+ful+CHAP0040" target="_blank" rel="noreferrer">40</a>, <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?051+ful+CHAP0084" target="_blank" rel="noreferrer">84</a>.</p>',3),i=[o];function c(s,l,d,p,h,f){return a(),t("div",null,i)}const m=e(r,[["render",c]]);export{v as __pageData,m as default};
